import {
  Routes,
  Route,
  useNavigationType,
  useLocation,
} from "react-router-dom";
import FrameComponent from "./pages/FrameComponent";
import IngestionVolTT from "./pages/IngestionVolTT";
import IngestionVolTT1 from "./pages/IngestionVolTT1";
import IngestionVolTT2 from "./pages/IngestionVolTT2";
import AlertSumTT from "./pages/AlertSumTT";
import GroupComponent from "./pages/GroupComponent";
import GroupComponent1 from "./pages/GroupComponent1";
import GroupComponent2 from "./pages/GroupComponent2";
import GroupComponent3 from "./pages/GroupComponent3";
import GroupComponent4 from "./pages/GroupComponent4";
import GroupComponent5 from "./pages/GroupComponent5";
import GroupComponent6 from "./pages/GroupComponent6";
import GroupComponent7 from "./pages/GroupComponent7";
import LoggingCost from "./pages/LoggingCost";
import GroupComponent8 from "./pages/GroupComponent8";
import GroupComponent9 from "./pages/GroupComponent9";
import GroupComponent10 from "./pages/GroupComponent10";
import GroupComponent11 from "./pages/GroupComponent11";
import AlertSummary from "./pages/AlertSummary";
import LandingPage from "./pages/LandingPage";
import { useEffect } from "react";

function App() {
  const action = useNavigationType();
  const location = useLocation();
  const pathname = location.pathname;

  useEffect(() => {
    if (action !== "POP") {
      window.scrollTo(0, 0);
    }
  }, [action, pathname]);

  useEffect(() => {
    let title = "";
    let metaDescription = "";

    switch (pathname) {
      case "/":
        title = "";
        metaDescription = "";
        break;
      case "/ingestion-vol-tt":
        title = "";
        metaDescription = "";
        break;
      case "/ingestion-vol-tt1":
        title = "";
        metaDescription = "";
        break;
      case "/ingestion-vol-tt2":
        title = "";
        metaDescription = "";
        break;
      case "/alert-sum-tt":
        title = "";
        metaDescription = "";
        break;
      case "/group-20":
        title = "";
        metaDescription = "";
        break;
      case "/group-19":
        title = "";
        metaDescription = "";
        break;
      case "/group-12":
        title = "";
        metaDescription = "";
        break;
      case "/group-18":
        title = "";
        metaDescription = "";
        break;
      case "/group-14":
        title = "";
        metaDescription = "";
        break;
      case "/group-17":
        title = "";
        metaDescription = "";
        break;
      case "/group-13":
        title = "";
        metaDescription = "";
        break;
      case "/group-11":
        title = "";
        metaDescription = "";
        break;
      case "/02-logging-cost":
        title = "";
        metaDescription = "";
        break;
      case "/group-15":
        title = "";
        metaDescription = "";
        break;
      case "/group-16":
        title = "";
        metaDescription = "";
        break;
      case "/group-33":
        title = "";
        metaDescription = "";
        break;
      case "/group-32":
        title = "";
        metaDescription = "";
        break;
      case "/01-alert-summary":
        title = "";
        metaDescription = "";
        break;
      case "/00-landing-page":
        title = "";
        metaDescription = "";
        break;
    }

    if (title) {
      document.title = title;
    }

    if (metaDescription) {
      const metaDescriptionTag = document.querySelector(
        'head > meta[name="description"]'
      );
      if (metaDescriptionTag) {
        metaDescriptionTag.content = metaDescription;
      }
    }
  }, [pathname]);

  return (
    <Routes>
      <Route path="/" element={<FrameComponent />} />

      <Route path="/ingestion-vol-tt" element={<IngestionVolTT />} />

      <Route path="/ingestion-vol-tt1" element={<IngestionVolTT1 />} />

      <Route path="/ingestion-vol-tt2" element={<IngestionVolTT2 />} />

      <Route path="/alert-sum-tt" element={<AlertSumTT />} />

      <Route path="/group-20" element={<GroupComponent />} />

      <Route path="/group-19" element={<GroupComponent1 />} />

      <Route path="/group-12" element={<GroupComponent2 />} />

      <Route path="/group-18" element={<GroupComponent3 />} />

      <Route path="/group-14" element={<GroupComponent4 />} />

      <Route path="/group-17" element={<GroupComponent5 />} />

      <Route path="/group-13" element={<GroupComponent6 />} />

      <Route path="/group-11" element={<GroupComponent7 />} />

      <Route path="/02-logging-cost" element={<LoggingCost />} />

      <Route path="/group-15" element={<GroupComponent8 />} />

      <Route path="/group-16" element={<GroupComponent9 />} />

      <Route path="/group-33" element={<GroupComponent10 />} />

      <Route path="/group-32" element={<GroupComponent11 />} />

      <Route path="/01-alert-summary" element={<AlertSummary />} />

      <Route path="/00-landing-page" element={<LandingPage />} />
    </Routes>
  );
}
export default App;
